import React from 'react';
import './ProcessUnitPage.css';

const HeatExchangerPage = () => (
  <div className="process-unit-page">
    <h1>Heat Exchanger</h1>
    <img src="https://images.unsplash.com/photo-1509228468518-180dd4864904?auto=format&fit=crop&w=800&q=80" alt="Heat Exchanger" className="unit-image" />
    <p>
      Heat exchangers transfer heat between two or more fluids. They are crucial for energy efficiency in chemical processes.
    </p>
  </div>
);

export default HeatExchangerPage;
